sources.style-responsive.scss:
@import url('https://fonts.googleapis.com/css2?family=Newsreader:wght@300;400&family=Quicksand:wght@300;400;500&family=Gugi&display=swap');
@import "./node_modules/@glidejs/glide/src/assets/sass/glide.core.scss";
@import "./node_modules/@glidejs/glide/src/assets/sass/glide.theme.scss";

$first-bg: #293950;
$radial-bg-left-hero: radial-gradient(circle at -10%, #aad9eb 0, #2a5b6d 15%, #293950 25%);
$radial-bg-left: radial-gradient(circle at -10%, #39aad3 0, #2a5b6d 10%, #293950 25%);
$radial-bg-right: radial-gradient(circle at 115%, #cae1eb 0, #2a5b6d 10%, #293950 25%);
$second-bg: #2e2e2e;
$nav-background-color: #2c2c2c;
$green-background-color: #88AA00;
$light-font-color: #e7e7e7;
$primary-font: 'Newsreader', serif;
$secondary-font: 'Quicksand', sans-serif;
$menu-font: 'Gugi', cursive;


@media screen and (min-width: 300px) and (max-width: 660px) {
  *, *::before, *::after {
    box-sizing: border-box;
    margin: 0;
    padding: 0;
  }

  main {
    overflow-x: hidden;
    overflow: hidden;

    #scene-container {
      position: absolute;
      top: 0;
      left: 0;
      z-index: -4;
      height: 50vh;
      opacity: .8;
    }
    
    .hero {
      height: 100vh;
      width: 100%;
      display: grid;
      grid-auto-flow: column;
      grid-template-rows: 1fr 1fr;
      grid-template-columns: 1fr;
      grid-template-areas: 
        "right1 right1"
        "left1 left1";
      gap: .5em;

      .hero__div-left {
        
        grid-area: left1;
        height: 80vh;

        .nav {
          margin: 2rem 0 0 10%;
          transform: translateX(-10%);

          ul {
            font-size: 1.5em;

            li {
              padding: 2rem 3rem;
            }
          }

        }
      }

      .hero__div-right {
        position: relative;
        grid-area: right1;
        height: 20vh;

        .hero__div-logo {
          padding-top: 3rem;
          width: 15rem;
        }

      }

    }

  }
  
  .science {
    margin-top: 0;
    width: 100%;
    height: 180vh;
    overflow: hidden;
    position: relative;
    background-image: $radial-bg-right;
  
    p {
      top: 27rem;
      opacity: .03;
      position: absolute;
      font-family: $menu-font;
      color: $light-font-color;
      font-size: 10em;
    }
  
    // .science__main {
    //   position: absolute;
    //   top: 22rem;
    //   width: 100%;
    //   padding: 0 1.5rem;

    //   canvas {
    //     width: 50%;
    //   }

    // }
  
    .science__content {
      display: block;
  
      .science__content-left {
        position: relative;
        width: 100vw;
        height: 50vh;
  
        p {
          display: inline-block;
          position: absolute;
          z-index: 4;
          margin: 1rem 2rem 1rem 1rem;
          top: 0;
          left: 0;
          opacity: 1;
          color: $light-font-color;
          font-family: $secondary-font;
          font-size: 1em;
          line-height: 1.7em;
          text-align: justify;
          margin-block-start: 0em;
          margin-block-end: 0em;
  
          span {
            font-family: $menu-font;
            font-size: 1.5em;
            letter-spacing: .2em;
            color: #d8c174;
          }
  
        }
  
      }
  
      .science__content-right {
        margin: 1rem 0;
        position: relative;
        width: 100vw;
        height: 100vh;
  
        .p-1, .p-2 {
          position: absolute;
          z-index: 5;
          top: 7rem;
          left: 2rem;
          opacity: 1;
          color: $light-font-color;
          font-family: $menu-font;
          font-size: 1.1em;
          letter-spacing: .2em;
        }
  
        .p-2 {
          top: 27rem;
          left: 2rem;
        }
  
        .glide-1 {
          position: absolute;
          z-index: 4;
          top: 8rem;
          left: .8rem;
          width: 90%;
          height: 16rem;
          opacity: 1;
          color: $light-font-color;
          font-family: $secondary-font;
          font-size: 1em;
          line-height: 1.5em;
          text-align: justify;
  
          .glide__track {
            background-color: hsla(46, 100%, 69%, 0.2);
            border-radius: 10px;
            height: 13rem;
            margin: 0 auto;
  
            .glide__slides {
              margin: 0;
    
              .glide__slide {
                padding: 1.5rem;
              }
    
            }
  
          }
  
          .glide__arrows {
  
            .glide__arrow {
              top: 13rem;
              border: 0;
              border-radius: 0;
              box-shadow: none;
  
              svg {
                fill: $first-bg;
